import React, { useEffect, useState } from 'react'
import { MDBAccordion, MDBAccordionItem } from 'mdb-react-ui-kit';

const ManageJobs = () => {

    const [currentUser, setCurrentUser] = useState(JSON.parse(localStorage.getItem('user')))
    console.log(currentUser);

    const [jobData, setJobData] = useState([])
    const [compData, setCompData] = useState([])
    const [loading, setLoading] = useState(false)

    const fetchCompData = async () => {
        setLoading(true);
        const res = await fetch('http://localhost:5000/profile/getbyuser/' + currentUser._id)
        setLoading(false);
        console.log(res.status)
        // console.log(currentUser._id)

        if (res.status === 200) {
            const data = await res.json();
            console.log(data)
            setCompData(data)
        }
    }

    const fetchJobData = async () => {
        setLoading(true);
        const res = await fetch('http://localhost:5000/add_jobs/getbyuser/' + currentUser._id)
        setLoading(false);
        console.log(res.status)
        // console.log(currentUser._id)

        if (res.status === 200) {
            const data = await res.json();
            console.log(data)
            setJobData(data)
        }
    }



    useEffect(() => {
        fetchCompData();
        fetchJobData();
    }, [])


    const displayDetails = () => {
        if (!loading && spaceData) {
            return (
                <div className='row'>
                    {
                        spaceData.map((space) => (

                            // <div className="row">

                            <div className="col-md-6">
                                <Accordion className='mt-3 border border-success rounded-6'>
                                    <AccordionSummary
                                        expandIcon={<ExpandMoreIcon />}
                                        aria-controls="panel1a-content"
                                        id="panel1a-header"
                                    >
                                        <Typography><h2>{space.name}</h2></Typography>
                                    </AccordionSummary>
                                    <AccordionDetails>
                                        <Typography>
                                            <Typography>
                                                Provider's Name : {space.providerName}
                                            </Typography>
                                            <Typography>
                                            Provider's Contact : {space.providerContact}
                                            </Typography>
                                            <Typography>
                                                Provider's Email : {space.providerEmail}
                                            </Typography>
                                            <Typography>
                                                Size : {space.size} sq feet
                                            </Typography>
                                            <Typography>
                                                Rate : ₹ {space.rate} per hours
                                            </Typography>
                                            <Typography>
                                                Location : {space.location}
                                            </Typography>
                                            <Typography>
                                                Facilities : {space.facilities}
                                            </Typography>
                                        </Typography>
                                    </AccordionDetails>
                                    <Link to={'/user/updateData/' + space._id}>
                                        <Button variant="contained" color='success' sx={{ marginLeft: '15px', marginBottom: '15px' }}>Update Data</Button>
                                    </Link>
                                    <Button variant="contained" color='error' sx={{ marginLeft: '15px', marginBottom: '15px' }} onClick={() => (deleteSpaceData(space._id))}>Delete</Button>
                                </Accordion>
                            </div>

                            // </div>
                        ))


                    }
                </div>

            )
        }
    }



    return (

        <div>
            <div className="card container">
                <div className="card-body">
                    {/* <h5 className="card-title">Card title</h5> */}
                    <div className="row">
                        <div className="col-md-4 my-auto">
                            <MDBAccordion>
                                <MDBAccordionItem collapseId={1} headerTitle='Accordion Item #1'>
                                    
                                </MDBAccordionItem>
                            </MDBAccordion>
                        </div>
                        <div className="col-md-8">
                            <MDBAccordion>
                                <MDBAccordionItem collapseId={1} headerTitle='Accordion Item #1'>
                                    dfsfsdfsf
                                </MDBAccordionItem>
                            </MDBAccordion>
                        </div>
                    </div>
                </div>
            </div>

        </div>
    )
}

export default ManageJobs
